window.bookSummaryJSON = "<p>Darren Shan, Vampire Prince and \"vampaneze\" killer, faces his worst nightmare yet - school. But homework is the least of Darren's problems. Bodies are piling up, time is running out, and the past is catching up with the hunters fast. Darren must forge new alliances and try to unravel the mystery behind the malevolent forces that have been set in motion against him.</p> <p>In this second part of the Hunters trilogy, the stakes are raised and the pace quickens to keep listeners on the edge of their seats. </p>"; 
